def main():
    global translations
    global Translations
    global Languages
    for tran in translations:
        from_lang = Languages.objects.get( abbr="%s" % 
                                          tran[0].lower())
        to_lang = Languages.objects.get(
                    abbr="%s" %  tran[1].lower())
        if (Translations.objects.filter(
                fromLang=from_lang, 
                toLang=to_lang,
                original="%s" % tran[2],
                definition="%s" % tran[3]).exists()
            == False):
            dj_translation = Translations (
                    fromLang=from_lang, 
                    toLang=to_lang,
                    original="%s" % tran[2],
                    definition="%s" % tran[3])
            dj_translation.save()

main()





